./app/Jobs/MarketplaceJob.php
<?php

namespace App\Jobs;

use App\Models\Category;
use App\Models\Product;
use GuzzleHttp\Client;
use Illuminate\Bus\Queueable;
use Illuminate\Contracts\Queue\ShouldQueue;
use Illuminate\Foundation\Bus\Dispatchable;
use Illuminate\Queue\InteractsWithQueue;
use Illuminate\Queue\SerializesModels;
use Illuminate\Support\Str;

class MarketplaceJob implements ShouldQueue
{
    use Dispatchable, InteractsWithQueue, Queueable, SerializesModels;

    protected $username;

    protected $take;

    public function __construct($username, $take)
    {
        $this->username = $username;
        $this->take = $take;
    }

    /**
     * Execute the job.
     *
     * @return void
     */
    public function handle()
    {
        $url = 'https://ruangapi.com/api/v1/shopee';
        $client = new Client();

        $response = $client->request('POST', $url, [
            'headers' => [
                'Authorization' => 'MASUKKAN API KEY ANDA DISINI',
            ],

            'form_params' => [
                'username' => $this->username,
                'take' => $this->take,
            ],
        ]);

        $body = json_decode($response->getBody(), true);

        foreach ($body['data']['results'] as $row) {

            $filename = Str::slug($row['title']).'-'.time().'.png';

            file_put_contents(storage_path('app/public/products/'.$filename), file_get_contents($row['images'][0]));

            $category = Category::first();

            if (count($row['categories']) > 0) {

                $category = Category::firstOrCreate([
                    'name' => $row['categories'][0],
                    'slug' => Str::slug($row['categories'][0]),
                ]);
            }

            Product::firstOrCreate(
                [
                    'name' => $row['title'],
                ],
                [
                    'slug' => Str::slug($row['title']),
                    'category_id' => $category->id,
                    'description' => $row['description'],
                    'image' => $filename,
                    'price' => $row['price'],
                    'weight' => 600,
                    'status' => 1,
                ]
            );
        }

        if (count($body['data']['results']) > 0) {

            MarketplaceJob::dispatch($this->username, $this->take + 10)->delay(now()->addMinutes(5));
        }
    }
}

./app/Jobs/ProductJob.php
<?php

namespace App\Jobs;

use App\Imports\ProductImport;
use App\Models\Product;
use Illuminate\Bus\Queueable;
use Illuminate\Contracts\Queue\ShouldQueue;
use Illuminate\Foundation\Bus\Dispatchable;
use Illuminate\Queue\InteractsWithQueue;
use Illuminate\Queue\SerializesModels;
use Illuminate\Support\Facades\Storage;
use Illuminate\Support\Str;

class ProductJob implements ShouldQueue
{
    use Dispatchable, InteractsWithQueue, Queueable, SerializesModels;

    protected $category;

    protected $filename;

    public function __construct($category, $filename)
    {
        $this->category = $category;
        $this->filename = $filename;
    }

    public function handle()
    {
        $files = (new ProductImport)->toArray(storage_path('app/public/uploads/'.$this->filename));

        foreach ($files[0] as $row) {

            $explodeURL = explode('/', $row[4]);
            $explodeExtension = explode('.', end($explodeURL));
            $filename = time().Str::random(6).'.'.end($explodeExtension);

            file_put_contents(storage_path('app/public/products').'/'.$filename, file_get_contents($row[4]));

            Product::create([
                'name' => $row[0],
                'slug' => $row[0],
                'category_id' => $this->category,
                'description' => $row[1],
                'price' => $row[2],
                'weight' => $row[3],
                'image' => $filename,
                'status' => true,
            ]);
        }
        Storage::delete(Storage::path('app/public/uploads/'.$this->filename));
    }
}

